        description:
          "\u00ab Lancyre en f\u00eate ! \u00bb revient pour sa 4\u00e8me \u00e9dition le samedi 17 et le dimanche 18 Mai au c\u0153ur du Ch\u00e2teau Lancyre en AOP Pic Saint Loup.\n \nVenez passer un moment festif \u00e0 nos c\u00f4t\u00e9s. Surprises garanties ! \n\nFORMULE \u00ab EPICURIENNE \u00bb (Balade) \u2013 35\u20ac adulte / Gratuit enfant\n \nDurant ces deux jours, un beau programme vous attend : \n \nMuni de votre kit (verre personnalis\u00e9, chapeau, porte-verre, programme, quizz\u2026) arpentez notre balade de 4.5km, au c\u0153ur de nos vignes avec panneaux th\u00e9matiques \n \nD\u00e9parts libres de 10h30 \u00e0 15h \n \nAccordez-vous une pause sur nos stands d\u00e9gustation et associez nos vins aux diff\u00e9rents amuse-bouches sal\u00e9s/sucr\u00e9s. Pour vos enfants, entre autres, des sirops artisanaux seront \u00e0 d\u00e9couvrir \u00e0 l\u2019aveugle \n \nTout au long du parcours, des animations th\u00e9matiques vous sont propos\u00e9es : \n\u2022\tImmersion dans les vignes avec R\u00e9gis et Christel Valentin, vignerons du domaine \n\u2022\tReconstitution et explication d\u2019une charbonni\u00e8re par Martial Acquarone \n\u2022\tVisite de la Chapelle d\u2019Aleyrac avec l\u2019Association des Amis de la Chapelle d\u2019Aleyrac (pour toute r\u00e9servation, 1\u20ac sera revers\u00e9 \u00e0 l\u2019Association) \n\u2022\tD\u00e9couverte du monde ol\u00e9icole avec Alice Badoux \u00e0 travers la d\u00e9gustation d\u2019huiles d\u2019olives du @moulindevillevieille (Sommi\u00e8res) \n \nEt bien d\u2019autres surprises festives ! \n\nFORMULE \u00ab FESTIVE \u00bb (Balade et Restaurant) \u2013 50\u20ac adulte / 12\u20ac enfant \n \nProlongez l\u2019exp\u00e9rience au Ch\u00e2teau Lancyre avec notre restaurant \u00e9ph\u00e9m\u00e8re. \n \nLe chef Fabrice du \u00ab Catering Gourmand \u00bb vous proposera : \n\u2022\tSaucisse de Toulouse ou Dos de Cabillaud pan\u00e9 \n\u2022\tGratin Dauphinois et l\u00e9gumes du soleil \n\u2022\tBouchons de ch\u00e8vre des garrigues \n\u2022\tCrumble pommes/poires au miel de garrigue \n\u2022\tCaf\u00e9 ou th\u00e9 \n \nPour les enfants jusqu\u2019\u00e0 12 ans, seule l\u2019option \u00ab Saucisse de Toulouse \u00bb est propos\u00e9e. \n \nPour l\u2019occasion, un bar \u00e0 vin et \u00e0 sirop est propos\u00e9, en suppl\u00e9ment, pour accompagner votre repas.\n \nNous sommes tous impatients de vous accueillir pour ce beau week-end \u00ab Lancyre en f\u00eate ! \u00bb",
