        description:
          "IMPORTANT: \u00e9v\u00e9nement initialement pr\u00e9vu les 10 et 11 mai et report\u00e9 aux 17-18 mai\n\nBOH\u00c8ME FEST\u2019 ! Un \u00e9v\u00e9nement \u00e0 l\u0027exp\u00e9rience immersive pour f\u00eater le printemps !\n\nLe March\u00e9 du Lez, organis\u00e9 par Synerg-In, vous invite \u00e0 un \u00e9v\u00e9nement unique et immersif pour c\u00e9l\u00e9brer le printemps !\n\nVenez d\u00e9couvrir un univers o\u00f9 l\u0027art, la musique et la mode se rencontrent pour cr\u00e9er une ambiance joyeuse et conviviale.\n\nLes 17 et 18 mai 2025, le March\u00e9 du Lez se transformera en un village boh\u00e8me et hippie-chic. Pendant tout le week-end, vous pourrez fl\u00e2ner dans un march\u00e9 sp\u00e9cialement d\u00e9cor\u00e9 pour l\u0027occasion. D\u00e9couvrez des tenues, accessoires, d\u00e9corations et objets d\u0027art inspir\u00e9s par la th\u00e9matique boh\u00e9mienne.\n\nParticipez \u00e0 divers ateliers et animations tout au long du week-end, comme des spectacles de danse, des ateliers DIY \u0026 Maquillages, des d\u00e9ambulations et des concerts. Les \u00e9tablissements du March\u00e9 du Lez se mettront aux couleurs de Coachella pour vous accueillir. \n\nVenez habill\u00e9s selon le dress code \u0022Boh\u00e8me \u0026 Hippie Chic\u0022 le samedi soir et participez au concours de la meilleure tenue ! De plus, des DJ animeront les Halles du Lez pour une ambiance musicale inoubliable.",
